import React from 'react'
import {useEffect} from "react"
import { useMachine } from '@xstate/react'
import { fetchMachine } from "../Utility/myFirstMachine"


export const Card = () => {
  const [fetchState, sendToFetchMachine] = useMachine(fetchMachine, {
    actions: {
      fetchData: (context, event) => {

      }
    }
  });
  // state.value                -> current state
  // send({ type: TRANSITION }) -> transition between states

  const URL = "https://api.thecatapi.com/v1/images/search";
  const LIMIT = "10";
  const KEY = "live_3H0P5gLpYlRVspXYdZgndGhjKVNAnTR2Mv634ZpCjkAbdlW75qNWsgCKz7SaeJ9B";
  const HAS_BREEDS = "1";
  const apiLink = `${URL}?limit=${LIMIT}&has_breeds=${HAS_BREEDS}&api_key=${KEY}`;
  const requestOptions = {
    method: "GET",
    redirect: "follow"
  };

  const sql2HubspotLoan = (row) => ({
    loan_number: row.loan_number,
    id: row.id,
    has_staged_funding: row.has_staged_funding,
    loan_status: row.loan_status,
    is_held: row.is_held,
    hold_comment: row.hold_comment,
    notes: row.notes,
    staged_funding_cost: toDollars(row.staged_funding_cost_cents),
    total_holdback_cost: toDollars(row.total_holdback_cost_cents),
    number_payment_stages: row.number_payment_stages,
    funding_remaining: toDollars(row.funding_remaining_cents),
    loan_status_code: row.loan_status_code,
    project_type: row.project_type,
    program_code: row.program_code,
    current_principal_balance: toDollars(row.current_principal_balance_cents),
    monthly_payment: toDollars(row.monthly_payment_cents),
    int_accrual_rate: row.int_accrual_rate,
    last_payment_date: (row.last_payment_date === null ? null : formatDate(row.last_payment_date)),
    next_due_date: formatDate(row.next_due_date),
    first_stage_payment: toDollars(row.first_stage_payment_cents),
    second_stage_payment: toDollars(row.second_stage_payment_cents),
    final_stage_payment: toDollars(row.final_stage_payment_cents),
    total_past_due: toDollars(row.total_past_due_cents),
    activation_fee: toDollars(row.activation_fee_cents),
    concierge_fee: toDollars(row.concierge_fee_cents),
    current_amount_due: toDollars(row.current_amount_due_cents),
    total_balance_due: toDollars(row.total_balance_due_cents),
    hold_status: row.hold_status,
    hold_date: (row.hold_date === null ? null : formatDate(row.hold_date)),
    is_delinquent: row.is_delinquent,
    days_past_due: row.days_past_due,
    completed_payments: row.completed_payments,
    portfolio_code: row.portfolio_code
    //loan_amount: toDollars(row.total_loan_amount_cents)
  
  });


  // API CALL
  useEffect(() => {
    console.log("Test")
    async function fetchCats(){
      await fetch(apiLink, requestOptions).then(
        (response) => response.json()
      ).then(
        (result) => console.log(result)
      ).catch(
        (error) => console.error(error));
    }
    fetchCats();
  });

  return (
    <div>
      {JSON.stringify(fetchState.value)}
      <button
        onClick = {() => {sendToFetchMachine({ type: "MOUSEOVER" });}}>
          MOUSEOVER
      </button>
      <button
        onClick = {() => {sendToFetchMachine({ type: "MOUSEOUT" });}}>
          MOUSEOUT
      </button>
    </div>
  )
}
